import React from 'react'
import {UserContext} from './App';

const ComF = () =>{
    return (
        <div>
        <UserContext.Consumer> {
           value => {
               console.log(value);
             return <h1> Is It really working {value}  </h1>}
            }
        }
       </UserContext.Consumer>
       </div>
    )
}

export default ComF;
